import ListTodos from "./components/listTodo";
function App() {
  return (
    <React.Fragment>
      {/* <div className="container">
      <InputTodo/>
      <ListTodos/>
      </div> */}
      <Routes>
        <Route path="/" element={<InputTodo />}>
        </Route>
        <Route path="/ListeTodos" element={<ListTodos />}>
        </Route>
      </Routes>
    </React.Fragment>
  );
}

export default App;
